<!DOCTYPE html><html><head><title>Pazi Policija React</title><meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1"><meta name="google-signin-client_id" content="AIzaSyB2Vxg0KuWymrqutiyBdXcqEIOLm0GZf40.apps.googleusercontent.com"><link href="styles.4eb45fa3ac0fc0effb27.css" rel="stylesheet"></head><body><script>(function() {
                'use strict'

                let listeners = {}
                let initialized = {}

                let initGoogle = {
                    initAuth() {
                        this.init('auth')
                    },
                    initMap() {
                        this.init('map')
                    },
                    init(name) {
                        initialized[name] = true
                        listeners[name] = listeners[name] || []
                        listeners[name].forEach(listener => listener())
                    },
                    listeners: [],
                    addListener(name, listener) {
                        if (initialized[name]) {
                            listener()
                            return function() {}
                        }

                        listeners[name] = listeners[name] || []
                        let index = (listeners[name].push(listener) - 1)

                        return function unreg() {
                            listeners.splice(index, 1)
                        }
                    }
                }

                window.initGoogle = initGoogle
            })();</script><script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyB2Vxg0KuWymrqutiyBdXcqEIOLm0GZf40&libraries=places&callback=initGoogle.initMap" async defer="defer"></script><script type="text/javascript" src="commons.js"></script><script type="text/javascript" src="bundle-4eb45fa3ac0fc0effb27.js"></script></body></html>
